import './UserView.jsx'

import Content from '../../components/Content/Content'

const HeaderProps = {
    title: "Listagem de pessoas"
}

const abc = [{
    nome: "wagner",
    idade: 23
},{
    nome: "Alves",
    idade: 23
}
]
class UserView extends Component {
    render() {
        return (
            <Content {...HeaderProps}>
                <div>
                    <form action=""></form>
                </div>
            </Content>
        )
    }
}

export default UserView;
